import React from 'react';
import { NavLink } from 'react-router-dom';
import classes from "./Dialogs.module.css";
import DialogItem from "./DialogItem"
import DialogMessage from "./DialogMessage";



const Dialogs = (props) => {

    let DialogsData =[
        {id:1, name:"Mike"},
        {id:2, name:"Vlad"},
        {id:3, name:"Petr"},
        {id:4, name:"Nastya"},
        {id:5, name:"Artem"}

    ];

    let MessageData = [
        {id:1, messange:"hi"},
        {id:2, messange:"hi"},
        {id:3, messange:"hi"},
        {id:4, messange:"hi"},
        {id:5, messange:"hi"}
    ]

    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>
                <DialogItem name={DialogsData[0].name} id={DialogsData[0].id} />
                <DialogItem name={DialogsData[1].name} id={DialogsData[1].id} />
                <DialogItem name={DialogsData[2].name} id={DialogsData[2].id} />
                <DialogItem name={DialogsData[3].name} id={DialogsData[3].id} />
                <DialogItem name={DialogsData[4].name} id={DialogsData[4].id} />
            </div>
            <div className={classes.messanges}>
                <DialogMessage messange={MessageData[0].messange}/>
                <DialogMessage messange={MessageData[1].messange}/>
                <DialogMessage messange={MessageData[2].messange} id={DialogMessage[2].id}/>
                <DialogMessage messange={MessageData[3].messange} id={DialogMessage[3].id}/>
                <DialogMessage messange={MessageData[4].messange} id={DialogMessage[4].id}/>
            </div>
        </div>
    )
}

export default Dialogs;
